<?phpnamespace Nemundo\Meteo\Dwd\Data\Map;class MapPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var MapModel*/public $model;public function __construct() {parent::__construct();$this->model = new MapModel();}/*** @return MapRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new MapRow($dataRow, $this->model);$list[] = $row;}return $list;}}